import Nav from './allComponents/nav.component.js';

class App extends React.Component {

  render(){
    var nav1 = [
      ['/', 'Home'],
      ['/micros/', 'Microgreens'],
      ['/natives/', 'Native Plants'],
      ['/team/', 'The Team']
    ];

    return (
      <div className="App">
        <header className="App-header">

          <Nav value={nav1}/>
          <img src={secure} alt='...'/>
          <h1 style={{fontFamily: 'papyrus',fontSize: '50px'}}>Secure Login</h1>

          <p>
              This will soon be EUG
          </p>
          <a
            className="App-link"
            href="http://evogrows.com"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn about EUG
          </a>
        </header>
      </div>
    );
  }
}

export default App;
